import React from "react";
import { Button } from "react-bootstrap";

const TestPage = () => {
    return (
        <div>
            <h1>Prueba de Botón</h1>
            <Button variant="primary">Botón de Prueba</Button>
        </div>
    );
};

export default TestPage;
